import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Cards";
import Sdata from "./Sdata";
const favMov = 'marvel';
const FavS = () =>{
if(favMov == "marvel"){
  return (
    <Card
    key={Sdata[1].key}
      imgsrc={Sdata[2].imgsrc}
      title={Sdata[1].title}
      mname={Sdata[1].mname}
      link={Sdata[1].link}
    />
  );
}
else{

}
};

ReactDOM.render(
  <>
    <h1 className="heading_style"> List of Marvel Movies</h1>

  </>,
  document.getElementById("root")
);
